import React from 'react';
import EmailItem from './EmailItem';

const sentEmails = [
  { id: 1, subject: "Meeting Reminder", sender: "you@mockgmail.com", body: "Don't forget our meeting at 10 AM." },
  { id: 2, subject: "Follow-up on Project", sender: "you@mockgmail.com", body: "Looking forward to your response." },
];

const SentPage = () => {
  return (
    <div>
      <h2>Sent Emails</h2>
      {sentEmails.map(email => (
        <EmailItem key={email.id} email={email} />
      ))}
    </div>
  );
};

export default SentPage;
